import { useEffect, useState } from 'react';
import React from 'react';
import CarItem from './CarItem';
import '../Styles/CarManagement.css';
import car1 from '../assets/images/car1.jpg';
import car2 from '../assets/images/car2.jpg';
import car3 from '../assets/images/car3.jpg';
import car4 from '../assets/images/car4.jpg';
import car5 from '../assets/images/car5.jpg';

const carImages = [car1, car2, car3, car4, car5];

function CarManagement() {
    const [cars, setCars] = useState([]);
    const [newName, setNewName] = useState("");
    const [newLocation, setNewLocation] = useState("");
    const [newPhoneNumber, setNewPhoneNumber] = useState("");
    const [newEmail, setNewEmail] = useState("");
    const [showAddForm, setShowAddForm] = useState(false);

    useEffect(() => {
        fetch("http://localhost:8080/api/car")
            .then(response => {
                if (!response.ok) {
                    throw new Error("Eroare la încărcarea datelor");
                }
                return response.json();
            })
            .then(data => {
                const carsWithImages = data.map((car, index) => ({
                    ...car,
                    imageUrl: index < carImages.length ? carImages[index] : null
                }));
                setCars(carsWithImages);
            })
            .catch(error => console.error("Eroare:", error));
    }, []);

    // Funcția pentru adăugarea unui showroom
    const handleAddCar = () => {
        const newCar = {
            name: newName,
            location: newLocation,
            phoneNumber: newPhoneNumber,
            email: newEmail,
        };

        fetch("http://localhost:8080/api/showroom", {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify(newCar),
        })
            .then(response => {
                if (!response.ok) {
                    throw new Error("Eroare la adăugarea showroom-ului");
                }
                return response.json();
            })
            .then((savedShowroom) => {
                console.log("Showroom adăugat:", savedShowroom);
                // Poți adăuga showroom-ul într-o listă dacă gestionezi showroom-uri în starea locală
                setNewName("");
                setNewLocation("");
                setNewPhoneNumber("");
                setNewEmail("");
                setShowAddForm(false); // Ascunde formularul
            })
            .catch(error => console.error("Eroare la adăugarea showroom-ului:", error));
    };

    return (
        <div>
            <h3>Management Mașini</h3>

            {/* Buton pentru afișarea formularului */}
            <div className="button-container">
                <button onClick={() => setShowAddForm(!showAddForm)}>
                    {showAddForm ? "Anulează Adăugarea Masinii" : "Adaugă Masina"}
                </button>
            </div>

            {/* Formular pentru adăugarea unui showroom */}
            {showAddForm && (
                <div className="add-form">
                    <h3>Adaugă Masina Noua</h3>
                    <label>
                        Nume:
                        <input
                            type="text"
                            value={newName}
                            onChange={(e) => setNewName(e.target.value)}
                        />
                    </label>
                    <label>
                        Locație:
                        <input
                            type="text"
                            value={newLocation}
                            onChange={(e) => setNewLocation(e.target.value)}
                        />
                    </label>
                    <label>
                        Număr de telefon:
                        <input
                            type="text"
                            value={newPhoneNumber}
                            onChange={(e) => setNewPhoneNumber(e.target.value)}
                        />
                    </label>
                    <label>
                        Email:
                        <input
                            type="email"
                            value={newEmail}
                            onChange={(e) => setNewEmail(e.target.value)}
                        />
                    </label>
                    <button onClick={handleAddCar}>Adaugă</button>
                    <button onClick={() => setShowAddForm(false)}>Anulează</button>
                </div>
            )}

            {/* Listarea mașinilor */}
            <div className="car-list">
                {cars.length > 0 ? (
                    cars.map((car, index) => (
                        <CarItem key={index} car={car} />
                    ))
                ) : (
                    <p>Nu există mașini disponibile.</p>
                )}
            </div>
        </div>
    );
}

export default CarManagement;
